import { Nav, Container, Navbar } from "react-bootstrap";
import { LinkContainer } from "react-router-bootstrap";
import logo from "../nasa.png";

const Menu = () => {
  return (
    <Navbar>
      <Container>
        <Navbar.Brand href="#home">
          <img
            alt=""
            src={logo}
            width="100"
            height="85"
            className="d-inline-block align-top"
          />
        </Navbar.Brand>
      </Container>
    </Navbar>
  );
};

export default Menu;
